"text": "<div>\n<i class=\"NoteType\">\nEvent Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThe Royal Russell School provided very well for Michael and Derek's education and personal development, paving the way for their future in to the working society as rounded gentlemen. As former pupils of the school they are called 'Old Russellians'.\n</p>\n<p>\nIf you are interested in learning more about the Royal Russell School, there is plenty of interesting reading on the <a href=\"https://www.royalrussell.co.uk/our-school/our-heritage\">Royal Russell web site</a>  and on <a href=\"https://en.wikipedia.org/wiki/Royal_Russell_School\">Wikipedia</a>\n</p>\n<p>\nhttps://www.royalrussell.co.uk/our-school/our-heritage\n</p>\n</div>\n</div>",
