"date_sdn": 2394933,
"descr": "Cooper - A cooper is a person trained to make wooden casks, barrels, vats, buckets, tubs, troughs and other staved containers from timber that was usually heated or steamed to make it pliable.",
"gid": "E0222",
"media": [],
"part_family": [],
"part_person": [
123
],
"place": 85,
"text": "<div>\n<i class=\"NoteType\">\nEvent Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nHenry Ambrose and Thomas (father) Page occupations, Cooper:\n</p>\n<p>\nIt is understood by Laura Perry nee Cheeseman, via her father Henry Cheeseman, that Henry Ambrose Page worked as a Cooper for the brewer 'Sheperd Neame' in Faversham, Kent. His occupation is confirmed by the details given in the Marriage Certificate.\n</p>\n<p>\nIt is apparent from the Record Transcription: Kent Marriages And Banns, that Thomas Page (father to Henry Ambrose) also did work as a Cooper.\n</p>\n<p>\n(A cooper is a person trained to make wooden casks, barrels, vats, buckets, tubs, troughs and other staved containers from timber that was usually heated or steamed to make it pliable.)\n</p>\n</div>\n<i class=\"NoteType\">\nEvent Reference Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nHenry Ambrose Page: Occupation: Cooper. By 1861 he had the job title of Master Cooper.\n</p>\n</div>\n</div>",
"type": "Occupation"
