"text": "<div>\n<i class=\"NoteType\">\nEvent Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-size:11px;\">Birth Place for Mahala Cant and the Cant family:</span>\n</p>\n<p>\n<span style=\"font-size:11px;\">According to 1911 Census Great Cornard is birth place of Mahala Cant ( wife to Herbert C Perry )and  is part of the town Sudbury in the district of Barburgh in the county of Suffolk. This is quite conceivable as Mahala and husband Herbert spent their latter years near by.</span>\n</p>\n<p>\n<span style=\"font-size:11px;\">Notably, Mahala's mother and sisters share the same county (Suffolk) for their birth place in the 1901 Census.</span>\n</p>\n</div>\n</div>",
